import { useEffect, useState } from "react";
import axios from "axios";

const Covics = () => {

    const [dataCovic, setdataCovic] = useState([]);
    //componentdidmount
    useEffect(async () => {
        let res = await axios.get('https://api.covid19api.com/country/vietnam?from=2021-10-01T00%3A00%3A00Z&to=2021-10-20T00%3A00%3A00Z');
        let data = res && res.data ? res.data : [];
        setdataCovic(data);
    }, []);
    return (
        <table id="customers">
            <thead>
                <tr>
                    <th>Confirmed</th>
                    <th>Active</th>
                    <th>Deaths</th>
                    <th>Recovered</th>
                </tr>
            </thead>
            <tbody>
                {dataCovic && dataCovic.length > 0 &&
                    dataCovic.map(item => {
                        return (
                            <tr key={item.ID}>
                                <td>Alfreds Futterkiste</td>
                                <td>Maria Anders</td>
                                <td>Germany</td>
                            </tr>
                        )
                    })}

            </tbody>
        </table>
    )
}
export default Covics;
